import React from 'react'

function NameList() {
    const names = ['Bruce', 'Clark', 'Diana']

    return (
        <div>
            <h2>{name[0]}</h2>    
            <h2>{name[1]}</h2>
            <h2>{name[2]}</h2>    
        </div>
    )
}

export default NameList
